    def scan(self):
        basicPortsText = "" #czyszczenie
        self.textEditPortsBasic.clear()
        self.Zuber.localip() #wywołanie portlistenera
        basicPortsText += ("Twoje IP:"+"\n")
        basicPortsText += (self.Zuber.getip()+"\n")
        self.textEditPortsBasic.setText(basicPortsText)
        adv_l = self.horizontalSlider.value() #wartości ze slajderów
        scans = self.horizontalSlider_2.value()
        #self.basicPortsText += (str(scans)+str(adv_l)+"\n")
        self.Zuber.set_timeout(0.00001*pow(100,adv_l)) #czas oczekiwania
        self.Zuber.listen(scans,adv_l) #skany, poziom zdokładności(zwiększa ilość skanów i wydłuża czas oczekiwania)
        basicPortsText += ("Otwarte Porty:"+"\n") #porty
